import CategoryList from '../data/category.json';

const category={
        
}
const Category = () => {
  return (
    <div>
      <>
        <Dropdown>
          <Dropdown.Toggle
            id="dropdown-button-dark-example1"
            variant="secondary"
          >
            Dropdown Button
          </Dropdown.Toggle>

          <Dropdown.Menu variant="dark">
            <Dropdown.Item href="/" active>
              Action
            </Dropdown.Item>
            {CategoryList.map((list,index)=>{
              return <Dropdown.Item href='/{list.title}'>{list.title} {index}</Dropdown.Item>
            })}
          </Dropdown.Menu>
        </Dropdown>
      </>
    </div>
  );
};

export default Category;
